過酷な環境に耐え、衝撃に強く割れにくい頑丈ボディーです。フタの紛失を防ぎ、フタの開閉に便利なカバーセイバー付きです。<BR><BR><font color=red><strong>※このスーパーカンは3年間保証です。保証書（本体側面に貼付け）と当店明細書は大切に保管して下さい。保証の際に必ず必要です。本製品はメーカーにおいて厳重なる品質管理のもとに検査され、合格したものであります。ご家庭での正常なご使用状態で万一われ、破損が生じましたら保証期間中のものはお取りかえいたします。但し、石油類・溶剤類・油脂類・洗剤類等に使用しますと、亀裂を生じることがあります。特別な用途へのご使用はさけて下さい。保証対象外となることがあります。</strong></font><br><br>
■本体サイズ：直径：43×高さ56cm<BR>
■ゴミ袋適合サイズ：65×80cm（45L）<BR>
■容量：45Ｌ<BR>
■素材：ポリエチレン、スチール<BR>
■生産国：日本<BR><BR>
